import React, {Component} from "react"

class AirlineFormPractice extends Component{

    constructor() {
        super()
        this.state = {
            firstName: "",
            lastName: "",
            age: "",
            gender: "",
            location: "",
            diet: ""
        }
        this.handleChange = this.handleChange.bind(this)
    }

    handleChange(event) {

        const {name, value} = event.target

        this.setState({
            [name] : value
        })
    }

    render() {
        return (
            <div>
                <h1>Airline booking website</h1>
                <label>
                    First Name:
                    <input type="text" value={this.state.firstName} onChange={this.handleChange}/>
                </label>
                <br/>
                <label>
                    Last Name:
                    <input type="text" value={this.state.lastName} onChange={this.handleChange}/>
                </label>
            </div>
        )
    }
}

export default AirlineFormPractice
